### Main TriplesMap
####################
<http://en.dbpedia.org/resource/Mapping_en:UK-artist-stub>
        a                      rr:TriplesMap ;
        rml:logicalSource      <LogicalSource> ;
        rr:predicateObjectMap  <ConstantMapping/0> ,
			       <EndDateMapping/0> ;
        rr:subjectMap          <SubjectMap> .


### Main SubjectMap
####################
<SubjectMap>  a      rr:SubjectMap ;
        rr:class     dbo:Agent ,
		     dul:Agent ,
		     dbo:Person ,
		     dul:NaturalPerson ,
		     dbo:Artist ,
		     schema:Person ,
		     owl:Thing ,
		     foaf:Person ,
		     wikidata:Q483501 ,
		     wikidata:Q5 ,
		     wikidata:Q215627 ;
        rr:template  "http://en.dbpedia.org/resource/{wikititle}" ;
        rr:termType  rr:IRI .


### LogicalSource
##################

<LogicalSource>  a                rml:LogicalSource ;
        rml:iterator              "Infobox" ;
        rml:referenceFormulation  ql:wikitext ;
        rml:source                "http://en.wikipedia.org/wiki/Mapping_en:UK-artist-stub?oldid=29058" .


###########
# Mappings
###########

### Predicate Object Map
#########################
<EndDateMapping/0>  a  rr:PredicateObjectMap ;
        rr:objectMap  <EndDateMapping/0/FTM> ;
        rr:predicate  dbo:name .

### Function Term Map
<EndDateMapping/0/FTM>
        a                   fnml:FunctionTermMap ;
        fnml:functionValue  <EndDateMapping/0/FTM/FV> .

### Function Execution Mapping
<EndDateMapping/0/FTM/FV>
        a                      rr:TriplesMap ;
        rml:logicalSource      <LogicalSource> ;
        rr:predicateObjectMap  <Function/EndDateFunction> ,
			       <EndDateMapping/0/FTM/FV/PropertyParameterPOM> ;
        rr:subjectMap          <SubjectMap/Function> .

### Parameters
<EndDateMapping/0/FTM/FV/PropertyParameterPOM>
        a             rr:PredicateObjectMap ;
        rr:objectMap  <EndDateMapping/0/FTM/FV/PropertyParameterPOM/OM> ;
        rr:predicate  dbf:endDatePropertyParameter .

### References
<EndDateMapping/0/FTM/FV/PropertyParameterPOM/OM>
        a              rr:ObjectMap ;
        rml:reference  "years_active" .


### Predicate Object Map
#########################
<ConstantMapping/0>  a  rr:PredicateObjectMap ;
        rr:object     dbr-en:United_Kingdom ;
        rr:predicate  dbo:country .


######################
# Conditional Mappings
######################



############
# Functions
############


<Function/EndDateFunction>
        a             rr:PredicateObjectMap ;
        rr:object     dbf:endDateFunction ;
        rr:predicate  fno:executes .


### Functions SubjectMap
#########################

<SubjectMap/Function>
        a            rr:SubjectMap ;
        rr:class     fno:Execution ;
        rr:termType  rr:BlankNode .
